window.bookSummaryJSON = "<p>She woke up drowning - inside a glass tank in a laboratory straight out of a science fiction movie. The mysterious, alluring stranger who rescues her clearly knows more than he's willing to reveal. Desperate and terrified, nameless and blinded by amnesia, she risks trusting her enigmatic savior and the dire warning he issues.</p> <p>The weirdest part of all? She remembers <i>his</i> name.</p> <p>Jake burns to tell her everything, but he's keeping more secrets than she realizes. He sat vigil beside her glass coffin for months, watching as scientists regenerated her body - and fantasizing about the woman she might once have been, never dreaming she'd wake up, because no one believed she could. Now, confronted with the reality of her, he discovers this bold and suspicious woman captivates him even more intensely than his fantasy.</p> <p>But as the rogue scientists responsible for her new life close in on them, the shocking truth about her origins, her past life, and her awakening threatens to destroy their burgeoning passion. Can the star-crossed lovers defeat their enemies before time runs out?</p> <p><b><i>Reborn to Die</i></b><b> is the first book in the Reborn series of paranormal romances.</b></p>"; 
